base64 -d /tmp/encodedimage > /tmp/background-image.jpg
sudo cp -r /tmp/background-image.jpg /usr/share/desktop-base/kali-theme/login/
sudo cp -r /tmp/background-image.jpg /usr/share/backgrounds/
sudo rm -r /tmp/encodedimage /tmp/background-image.jpg

cat << EOF > /tmp/lightdm-gtk-greeter.conf
[greeter]
background = /usr/share/desktop-base/kali-theme/login/background-image.jpg
theme-name = Kali-Dark
font-name = Cantarell 11
icon-theme-name = Flat-Remix-Blue-Light
xft-antialias = true
xft-dpi = 96
xft-hintstyle = slight
xft-rgba = rgb
indicators = ~power
clock-format = %d %b, %H:%M
screensaver-timeout = 60
default-user-image = #emblem-kali
keyboard = onboard
EOF

sudo mv /tmp/lightdm-gtk-greeter.conf /etc/lightdm/
sudo chown root:root /etc/lightdm/lightdm-gtk-greeter.conf

sudo cp -r templates/template_shortcuts /home/$USER/.config/xfce4/xfconf/xfce-perchannel-xml/xfce4-keyboard-shortcuts.xml

xfconf-query -c xfce4-desktop -p /backdrop/screen0/monitorVirtual1/workspace0/last-image -s /usr/share/backgrounds/background-image.jpg
xfconf-query -c xfce4-desktop -p /desktop-icons/file-icons/show-filesystem -s false
xfconf-query -c xfce4-desktop -p /desktop-icons/file-icons/show-home -s false
xfconf-query -c xfce4-desktop -p /desktop-icons/file-icons/show-trash -s false
xfconf-query -c xfce4-panel -n -p /panels/panel-1/autohide-behavior -t "uint" -s 2

sudo rm -r -f /home/$USER/.config/qterminal.org
sudo mkdir /home/$USER/.config/qterminal.org

sudo -u root mkdir /root/.config/
sudo -u root rm -r -f /root/.config/qterminal.org
sudo -u root mkdir /root/.config/qterminal.org

sudo cp -r powerlevel9k /usr/share/

if [[ $(grep 'POWERLEVEL9K_MODE="awesome-fontconfig"' /home/$USER/.zshrc) == '' ]];
then
	echo 'POWERLEVEL9K_MODE="awesome-fontconfig"' >> /home/$USER/.zshrc
fi

if [[ $(grep "POWERLEVEL9K_TIME_ICON=''" /home/$USER/.zshrc) == '' ]];
then
	echo "POWERLEVEL9K_TIME_ICON=''" >> /home/$USER/.zshrc
fi

if [[ $(grep "POWERLEVEL9K_CONTEXT_TEMPLATE" /home/$USER/.zshrc) == '' ]];
then
	echo 'POWERLEVEL9K_CONTEXT_TEMPLATE="`whoami`"' >> /home/$USER/.zshrc
fi

if [[ $(grep "POWERLEVEL9K_CONTEXT_DEFAULT_FOREGROUND" /home/$USER/.zshrc) == '' ]];
then
	echo "POWERLEVEL9K_CONTEXT_DEFAULT_FOREGROUND='blue'" >> /home/$USER/.zshrc
fi

if [[ $(grep "source '/usr/share/powerlevel9k/powerlevel9k.zsh-theme'" /home/$USER/.zshrc) == '' ]];
then
	echo "source '/usr/share/powerlevel9k/powerlevel9k.zsh-theme'" >> /home/$USER/.zshrc
fi

if [[ $(grep 'echo -n -e "\\e\[5 q"' /home/$USER/.zshrc) == '' ]];
then
	echo 'echo -n -e "\e[5 q"' >> /home/$USER/.zshrc
fi

function root_config(){

cat << "EOF" > /tmp/root_script.sh
#!/bin/bash
if [[ $(grep 'POWERLEVEL9K_MODE="awesome-fontconfig"' /root/.zshrc) == '' ]];
then
        echo 'POWERLEVEL9K_MODE="awesome-fontconfig"' >> /root/.zshrc
fi

if [[ $(grep "POWERLEVEL9K_TIME_ICON=''" /root/.zshrc) == '' ]];
then
        echo "POWERLEVEL9K_TIME_ICON=''" >> /root/.zshrc
fi

if [[ $(grep "POWERLEVEL9K_CONTEXT_TEMPLATE" /root/.zshrc) == '' ]];
then
	echo 'POWERLEVEL9K_CONTEXT_TEMPLATE="`whoami`"' >> /root/.zshrc
fi

if [[ $(grep "POWERLEVEL9K_CONTEXT_ROOT_FOREGROUND" /root/.zshrc) == '' ]];
then
	echo "POWERLEVEL9K_CONTEXT_ROOT_FOREGROUND='red'" >> /root/.zshrc
fi

if [[ $(grep "POWERLEVEL9K_ROOT_ICON" /root/.zshrc) == '' ]];
then
	echo "POWERLEVEL9K_ROOT_ICON=$'\u26A1'              # ⚡" >> /root/.zshrc
fi

if [[ $(grep "source '/usr/share/powerlevel9k/powerlevel9k.zsh-theme'" /root/.zshrc) == '' ]];
then
        echo "source '/usr/share/powerlevel9k/powerlevel9k.zsh-theme'" >> /root/.zshrc
fi

if [[ $(grep 'echo -n -e "\\e\[5 q"' /root/.zshrc) == '' ]];
then
	echo 'echo -n -e "\e[5 q"' >> /root/.zshrc
fi
EOF

sudo -u root bash /tmp/root_script.sh
sudo -u root rm /tmp/root_script.sh
}

sudo sed -i -e 's/GRUB_CMDLINE_LINUX_DEFAULT=.*/GRUB_CMDLINE_LINUX_DEFAULT="quiet loglevel=0"/g' /etc/default/grub
sudo update-grub
root_config

X=$(xrandr --current | grep '*' | uniq | awk '{print $1}' | cut -d 'x' -f1)
Y=$(xrandr --current | grep '*' | uniq | awk '{print $1}' | cut -d 'x' -f2)
sed -i -e "s/size=@Size(640 480)/size=@Size($X $Y)/g" templates/template_qterminal
sed -i -e "s/fixedSize=@Size.*/fixedSize=@Size($X $Y)/g" templates/template_qterminal

sudo -u root cp -r templates/template_qterminal /home/$USER/.config/qterminal.org/qterminal.ini
sudo -u root cp -r templates/template_qterminal /root/.config/qterminal.org/qterminal.ini
sudo -u root chown -R $USER:$USER /home/$USER/.config/qterminal.org
sudo -u root chown -R root:root /root/.config/qterminal.org
notify-send "Configuration updated"
notify-send "To apply new shortcuts system needs to be reboot"
killall qterminal
